import React from 'react';
import { Carousel, Container, Row, Col } from 'react-bootstrap';
import item1 from '../pictures/photo.jpg';
import item2 from '../pictures/barber.jpg';
import item3 from '../pictures/beard trimming.jpg';
import logo from '../pictures/head.png';
import styled from 'styled-components';

const Styles = styled.div`
.carousel {

}
.container {
  display: flex;
  position: relative;
  left: 0px;
  top: 0px;
  z-index: 2;
  padding: 2em 0;
  
  p {
    font-size: 8vw;
    text-shadow: 0.05em 0.05em #000;
    padding: 1.5vw 5vw;
    
  }
}

.bg {
  z-index: 1;
  position: absolute;
  heigth: 100%
}

`

function Home() {
  return (
    <Styles id="home">
      <Carousel interval={100000}>
        <Carousel.Item>
          <img
            className="d-block w-100 bg"
            src={item1}
            alt="Second slide"
          />
         
            <ul>
              <li>
                <p>Barber</p>
              </li>
              <li>
                <img
                  className="d-block w-100"
                  src={logo}
                  alt="Second slide"
                />
              </li>
              <li>
                <p>Andrew</p>
              </li>
            </ul>
        </Carousel.Item>
          <Carousel.Item>
            <img
              className="d-block w-100"
              src={item2}
              alt="Second slide"
            />
          </Carousel.Item>
          <Carousel.Item>
            <img
              className="d-block w-100"
              src={item3}
              alt="Third slide"
            />
          </Carousel.Item>
      </Carousel>
    </Styles>

      )
    }
    
export default Home;
